### Summary of Core Topics, Concepts, Principles, and Equations

#### 1. **Sorting Algorithms**
- **Stable Sort**: Maintains the relative order of items with equal keys.
- **Quick Sort**:
  - **Recurrence Relation**: \( T(n) = T(n-1) + O(n) \)
  - **Time Complexity**: \( O(n^2) \) in the worst case.
- **Merge Sort**:
  - **Recurrence Relation**: \( T(n) = 2T\left(\frac{n}{2}\right) + O(n) \)
  - **Time Complexity**: \( O(n \log n) \)
  - **Depth of Recursion Tree**: \( O(\log n) \)
  - **Merge Operation Complexity**: \( O(n) \)
  - **Not In-place**: Requires additional space.

#### 2. **Data Structures**
- **Stack**: LIFO (Last In, First Out) structure.
  - **Operations**: `push()` and `pop()`
  - **Time Complexity**: \( O(1) \) for both operations.
- **Queue**: FIFO (First In, First Out) structure.
  - **Operations**: `enqueue()` and `dequeue()`
  - **Time Complexity**: \( O(1) \) for both operations.
- **Linked List**:
  - **Operations**: Insertion and deletion at head.
  - **Time Complexity**: \( O(1) \) for both operations.
- **Graph**:
  - **BFS (Breadth-First Search)**: Traverses level by level.
    - **Complexity**: \( O(m + n) \) using adjacency list.
    - **Applications**: Reachability, cycle detection.
  - **DFS (Depth-First Search)**: Traverses depth-first.
    - **Applications**: Topological sorting, cycle detection.
  - **Topological Ordering**: Linear ordering of vertices such that for every directed edge \( u \rightarrow v \), vertex \( u \) comes before \( v \).

#### 3. **Algorithms and Complexity**
- **Big-O Notation**: Describes the upper bound of an algorithm's running time.
  - **Examples**:
    - \( f(n) = 10n^4 + 6n^3 \) is \( O(n^4) \)
    - \( g(n) = 10n^3 + 2n^2 \) is \( O(n^3) \)
    - \( h(n) = 12n^3 \log n + 6n^2 \) is \( O(n^3 \log n) \)
- **Binary Search**:
  - **Time Complexity**: \( O(\log n) \)
  - **Comparisons**: Number of comparisons depends on the depth of the recursion tree.

#### 4. **Graph Theory**
- **Degree Sequence**: Series of positive integers representing the degrees of vertices.
- **Maximum Number of Edges**: In an undirected connected graph with \( n \) vertices, the maximum number of edges is \( \frac{n(n-1)}{2} \).

#### 5. **Hashing**
- **Linear Probing**: Open addressing scheme for resolving hash collisions.
  - **Hash Function**: \( \text{key} \mod 10 \)
  - **Insertion**: Increment the index by 1 until a free slot is found.

